import React from 'react';
import Appbar from '../public_comp/Appbar';
import Postfeatured from './Postfeatured'
import weather from '../public_comp/index'

const Main = () => {
  return (
    <>
      <Appbar />
      <Postfeatured />
      <weather />
    </>
  );
};

export default Main;
